import mobile2x_1 from '../../image/main_img/1mobile2x.png'
import tablet2x_1 from '../../image/main_img/1tablet2x.png'
import desktop2x_1 from '../../image/main_img/1desktop2x.png'
import mobile2x_2 from '../../image/main_img/2mobile2x.png'
import tablet2x_2 from '../../image/main_img/2tablet2x.png'
import desktop2x_2 from '../../image/main_img/2desktop2x.png'
import mobile2x_3 from '../../image/main_img/3mobile2x.png'
import tablet2x_3 from '../../image/main_img/3tablet2x.png'
import desktop2x_3 from '../../image/main_img/3desktop2x.png'
const MainPage = () => {
    return (
        <div className="mainContainer">
            
            <h1 className="mainTitle">Take good care of your small pets</h1>
            <div className="imageContainer">
                <img  srcset={`${mobile2x_1} 300w, ${tablet2x_1} 600w, ${desktop2x_1} 1200w`}
                       src={desktop2x_1}
                        alt="dog"
                        className="imageTwo" />
               <img  srcset={`${mobile2x_2} 300w, ${tablet2x_2} 600w, ${desktop2x_2} 1200w`}
                       src={desktop2x_2}
                        alt="dog"
                        className="imageOne" />
                        <img  srcset={`${mobile2x_3} 300w, ${tablet2x_3} 600w, ${desktop2x_3} 1200w`}
                       src={desktop2x_3}
                        alt="dog"
                        className="imageThree" />
            </div>
        </div>
    );
}

export default MainPage;
